 INSERT INTO srdb.assessment VALUES('AFSC-POPERCHGA-1959-2010-Stachura', 'AFSC', 'POPERCHGA', 'Stachura', '2011-03-29', '2011-06-14 14:17:40', '1959-2010', 'http://www.afsc.noaa.gov/REFM/docs/2010/GOApop.pdf', 'Dana Hanselman, Dana.Hanselman@noaa.gov', '2010 assessment is just update of 2009 assessment (AFSC-POPERCHGA-2009.pdf); also accessed additional data not included in the SAFE through the summary estimates of the 2009 assessments (AFSC_2009_assessments_historical_estimates.xls)', '', 1, 1, 'AD-CAM', 'A notable change from the 2007 configuration is a much larger value of F40% and F35%. This increase in recommended fishing mortality from 0.06 to 0.12 is due to the change in current fishery selectivity.', '../spreadsheets/STACHURA-POPERCHGA-2010-editedDR.xls', '999') ; 
